const map = new Map();
const lookup = new Map();

function firstChar(emoji) {
    let word = emoji;
    if(emoji.startsWith(':')) word = emoji.substring(1);
    return word.charAt(0);
}

window.onload = init;

function init() {
    if(map.size > 0 && lookup.size > 0) return;
    map.clear();
    lookup.clear();

    for(let emoji of Object.keys(emojis)) {
        let char = firstChar(emoji);
        let arr;
        if(map.has(char)) {
            arr = map.get(char);
        } else {
            arr = new Array();
        }

        arr.push(emoji);
        map.set(char, arr);

        lookup.set(emojis[emoji], emoji);
    }

    document.getElementById('encodeButton').addEventListener('click', () => {
        let output = encode(document.getElementById('plain').value);
        document.getElementById('emojicrypt').value = output;
    });

    document.getElementById('decodeButton').addEventListener('click', () => {
        let output = decode(document.getElementById('emojicrypt').value);
        document.getElementById('plain').value = output;
    });
};

function get_emoji(char) {
    if(!map.has(char)) return char;

    let arr = map.get(char);
    let random = arr[Math.floor(Math.random() * arr.length)];
    return emojis[random];
}

function encode(msg) {
    let lower = msg.toLowerCase();
    let outBuf = "";
    for(let idx = 0; idx < lower.length; idx++) {
        outBuf += get_emoji(lower.charAt(idx));
    }
    return outBuf;
}

function decode(msg) {
    let outBuf = "";
    let chars = [...msg];

    for(let char of chars) {
        if(lookup.has(char)) {
            let emoji = lookup.get(char);
            if(emoji.startsWith(":tone")) continue;
            outBuf += firstChar(emoji);
        } else outBuf += char;
    }
    return outBuf.trim();
}


